import React from "react";
import { useState } from "react";

const api = "d929b80c2587abdc6dbda7f96c9ff6c5";
const testCity = "Paris";

function Search(props) {
  const [weather, setWeather] = useState("FUCK");

  const keyPress = (a) => {
    if (a.key === "Enter") {
      fetch(
        `https://api.openweathermap.org/data/2.5/weather?q=${testCity}&appid=${api}`
      )
        .then((response) => response.json())
        .then((data) => {
          setWeather(data);
        })

        .catch((error) => {
          console.log("error");
        });
    }
  };

  return (
    <div>
      <input onKeyPress={keyPress} />
      <div>{}</div>
    </div>
  );
}

export default Search;
